eAccount; // the account that receives exchange\r\n\tuint256 public feePercent; // testing fee percentage NEED TO CHANGE to real fee\r\n\taddress constant ETHER = address(0); //store Ether in tokens mapping with blank address\r\n\tmapping(address => mapping(address => uint256)) public tokens;\r\n\tmapping(uint256 => _Order) public orders;\r\n\tuint256 public orderCount;\r\n\tmapping(uint256 => bool) public orderCancelled;\r\n\tmapping(uint256 => bool) public orderFilled;\r\n\r\n\t // Events\r\n    event Deposit(address token, address user, uint256 amount, uint256 balance);\r\n    event Withdraw(address token, address user, uint256 amount, uint256 balance);\r\n    event Order(\r\n    \tuint256 id,\r\n    \taddress user,\r\n    \taddress tokenGet,\r\n    \tuint256 amountGet,\r\n    \taddress tokenGive,\r\n    \tuint256 amountGive,\r\n    \tuint256 timestamp\r\n    );\r\n\r\n    event Cancel(\r\n    \tuint256 id,\r\n    \taddress user,\r\n    \taddress tokenGet,\r\n    \tuint256 amountGet,\r\n    \taddress tokenGive,\r\n    \tuint256 amountGive,\r\n    \tuint256 timestamp\r\n    );\r\n\r\n    event Trade(\r\n    \tuint256 id,\r\n    \taddress user,\r\n    \taddress tokenGet,\r\n    \tuint256 amountGet,\r\n    \taddress tokenGive,\r\n    \tuint256 amountGive,\r\n    \taddress userFill,\r\n    \tuint256 timestamp\r\n    );\r\n\r\n    // Structs\r\n    // Model Order\r\n    struct _Order {\r\n    \t uint256 id;\r\n    \t address user;\r\n    \t address tokenGet;\r\n    \t uint256 amountGet;\r\n    \t address tokenGive;\r\n    \t uint256 amountGive;\r\n    \t uint256 timestamp;\r\n    }\r\n\r\n  \r\n\tconstructor (address _feeAccount, uint256 _feePercent) public {\r\n\t\tfeeAccount = _feeAccount;\r\n\t\tfeePercent = _feePercent;\r\n\t}\r\n\r\n\t//Fallback: reverts if Ether is sent to this smart contract by mistake\r\n\tfunction() external {\r\n\t\trevert();\r\n\t}\r\n\r\n\tfunction depositEther() payable public {\r\n\t\ttokens[ETHER][msg.sender] = tokens[ETHER][msg.sender].add(msg.value);\r\n\t\temit Deposit(ETHER, msg.sender, msg.value, tokens[ETHER][msg.sender]);\r\n\t}\r\n\t\r\n\tfunction withdrawEther(uint _amount) public {\r\n        require(tokens[ETHER][msg.sender] >= _amount);\r\n        tokens[ETHER][msg.sender] = tokens[ETHER][msg.sender].sub(_amount);\r\n        msg.sender.transfer(_amount);\r\n        emit Withdraw(ETHER, msg.sender, _amount, tokens[ETHER][msg.sender]);\r\n    }\r\n\r\n\tfunction depositToken(address _token, uint _amount) public {\r\n\t\trequire(_token != ETHER);\r\n\t\trequire(Token(_token).transferFrom(msg.sender, address(this), _amount));\r\n\t\ttokens[_token][msg.sender] = tokens[_token][msg.sender].add(_amount);\r\n\t\temit Deposit(_token, msg.sender, _amount, tokens[_token][msg.sender]);\r\n\t}\r\n\r\n\tfunction withdrawToken(address _token,uint256 _amount) public {\r\n\t\trequire(_token != ETHER);\r\n\t\trequire(tokens[_token][msg.sender] >= _amount);\r\n\t\ttokens[_token][msg.sender] = tokens[_token][msg.sender].sub(_amount);\r\n\t\trequire(Token(_token).transfer(msg.sender, _amount));\r\n\t\temit Withdraw(_token, msg.sender, _amount, tokens[_token][msg.sender]);\r\n\t}\r\n\r\n\tfunction balanceOf(address _token, address _user) public view returns (uint256) {\r\n\t\treturn tokens[_token][_user];\r\n\t\t}\r\n\r\n\tfunction makeOrder(address _tokenGet, uint256 _amountGet, address _tokenGive, uint256 _amountGive) public {\r\n\t\torderCount = orderCount.add(1);\r\n\t\torders[orderCount] = _Order(orderCount, msg.sender, _tokenGet, _amountGet, _tokenGive, _amountGive, now);\r\n\t\temit Order(orderCount, msg.sender, _tokenGet, _amountGet, _tokenGive, _amountGive, now);\r\n\t}\r\n\r\n\tfunction cancelOrder(uint256 _id) public { \r\n\t\t_Order storage _order = orders[_id];\r\n\t\trequire(address(_order.user) == msg.sender); // Must be "my" order\r\n\t\trequire(_order.id == _id); // the order must exist\r\n\t\t\r\n\t\t//Must be a valid order\r\n\t\torderCancelled[_id] = true;\r\n\t\temit Cancel(_order.id, msg.sender, _order.tokenGet, _order.amountGet, _order.tokenGive, _order.amountGive, now);\r\n\t}\r\n\r\n\tfunction fillOrder(uint256 _id) public {\r\n\t\trequire(_id > 0 && _id <= orderCount);\r\n\t\trequire(!orderFilled[_id]);\r\n\t\trequire(!orderCancelled[_id]);\r\n\t\t_Order storage _order = orders[_id];\r\n\t\t_trade(_order.id, _order.user, _order.tokenGet, _order.amountGet, _order.tokenGive, _order.amountGive);\r\n\t\torderFilled[_order.id] = true;\t\r\n\t}\r\n\r\n\tfunction _trade(uint256 _orderId, address _user, address _tokenGet, uint256 _amountGet, address _tokenGive, uint256 _amountGive) internal{\r\n\t\t// fee paid by the user that filles the order, aka msg.sender\r\n\t\t//fee deducted from _amountGet\r\n\t\tuint256 _feeAmount = _amountGet.mul(feePercent).div(100);\r\n\t\t\r\n\t\ttokens[_tokenGet][msg.sender] = tokens[_tokenGet][msg.sender].sub(_amountGet.add(_feeAmount));\r\n\t\ttokens[_tokenGet][_user] = tokens[_tokenGet][_user].add(_amountGet);\r\n\t\ttokens[_tokenGet][feeAccount] = tokens[_tokenGet][feeAccount].add(_feeAmount);\r\n\t\ttokens[_tokenGive][_user] = tokens[_tokenGive][_user].sub(_amountGive);\r\n\t\ttokens[_tokenGive][msg.sender] = tokens[_tokenGive][msg.sender].add(_amountGive);\r\n\t\t\r\n\t\temit Trade(_orderId, _user, _tokenGet, _amountGet, _tokenGive, _amountGive, msg.sender, now);\r\n\t}\r\n\r\n}',sourcePath:"C:\\pr0\\blockchain-developer-bootcamp\\src\\contracts\\Exchange.sol",ast:{absolutePath:"project:/src/contracts/Exchange.sol",exportedSymbols:{Exchange:[777]},id:778,nodeType:"SourceUnit",nodes:[{id:129,literals:["solidity","^","0.5",".16"],nodeType:"PragmaDirective",src:"0:24:1"},{absolutePath:"project:/src/contracts/Token.sol",file:"./Token.sol",id:130,nodeType:"ImportDirective",scope:778,sourceUnit:1008,src:"28:21:1",symbolAliases:[],unitAlias:""},{absolutePath:"openzeppelin-solidity/contracts/math/SafeMath.sol",file:"openzeppelin-solidity/contracts/math/SafeMath.sol",id:131,nodeType:"ImportDirective",scope:778,sourceUnit:12